                Hi, I am Shreya Kathuriya. I am currently in my final semester of software engineering (honours).
                I study at Monash University.<br/> Apart from coding, I like engaging in activities like painting, playing the piano, 
                graphology, making videos and clicking pictures!
            </div>
        </div>
    );

  }

